import React from 'react';

const Food = () => (
    <div>
        <h2>Food</h2>
        <p>Discover the delicious food of Penang:</p>
        <ul>
            <li>Char Kway Teow</li>
            <li>Penang Laksa</li>
            <li>Nasi Kandar</li>
        </ul>
    </div>
);

export default Food;
